import { useEffect } from "react";
import { useLocation } from "react-router-dom";
import '../styles/navbar.css'

export default function NavbarEffect({ links }) {
  const location = useLocation();

  useEffect(() => {
    console.log("NavbarEffect loaded!");
  }, []);

  return (
    <nav>
      <label htmlFor=""><svg xmlns="http://www.w3.org/2000/svg" height="24px" viewBox="0 -960 960 960" width="24px" fill="#1f1f1f"><path d="M120-240v-80h720v80H120Zm0-200v-80h720v80H120Zm0-200v-80h720v80H120Z"/></svg></label>
      <ul>
        {links && links.map((link, index) => (
          <li key={index} className={location.pathname === link.href ? "active" : ""}>
            <a href={link.href}>{link.name}</a>
          </li>
        ))}
      </ul>
    </nav>
  );
}
